import React from "react";
import { Grid, Select } from "semantic-ui-react";

const WithSelect = ({ name, options }: { name: string; options: any }) => {
  return (
    <React.Fragment>
      <Grid.Column textAlign="center" className="selectable">
        <Select
          placeholder={`Select ${name}`}
          options={options}
          value={options[1].value}
        />
      </Grid.Column>
    </React.Fragment>
  );
};

export default WithSelect;
